<span class="t s0" style="left:110px;bottom:921px;letter-spacing:-0.1px;word-spacing:0.02px;">1. Information We Collect </span>
<span class="t s0" style="left:110px;bottom:899px;letter-spacing:-0.09px;">When you use our App, we may collect the following information: </span>
<span class="t s0" style="left:110px;bottom:854px;letter-spacing:-0.09px;word-spacing:0.01px;">Email Address: We collect your email address when you register or log in to the app. This is </span>
<span class="t s0" style="left:110px;bottom:832px;letter-spacing:-0.09px;">used for account verification, communication, and support purposes. </span>
<span class="t s0" style="left:110px;bottom:788px;letter-spacing:-0.17px;word-spacing:0.08px;">2. How We Use Your Information </span>
<span class="t s0" style="left:110px;bottom:766px;letter-spacing:-0.1px;word-spacing:0.01px;">We use the collected email address for the following purposes: </span>
<span class="t s0" style="left:110px;bottom:721px;letter-spacing:-0.13px;word-spacing:0.04px;">To verify your identity and create your user account. </span>
<span class="t s0" style="left:110px;bottom:677px;letter-spacing:-0.12px;word-spacing:0.03px;">To communicate important updates, notifications, or support-related messages. </span>
<span class="t s0" style="left:110px;bottom:632px;letter-spacing:-0.15px;word-spacing:0.06px;">To improve user experience and application functionality. </span>
<span class="t s0" style="left:110px;bottom:588px;letter-spacing:-0.09px;">3. Sharing of Information </span>
<span class="t s0" style="left:110px;bottom:566px;letter-spacing:-0.09px;word-spacing:0.01px;">We do not share, sell, rent, or trade your email address with third parties for marketing </span>
<span class="t s0" style="left:110px;bottom:543px;letter-spacing:-0.09px;">purposes. </span>
<span class="t s0" style="left:110px;bottom:499px;letter-spacing:-0.1px;word-spacing:0.01px;">We may share your information only in the following cases: </span>
<span class="t s0" style="left:110px;bottom:454px;letter-spacing:-0.09px;">Legal Requirements: If required by law or subpoena. </span>
<span class="t s0" style="left:110px;bottom:410px;letter-spacing:-0.15px;word-spacing:0.07px;">To Prevent Harm or Fraud: To protect the rights, property, or safety of our users or others. </span>
<span class="t s0" style="left:110px;bottom:366px;letter-spacing:-0.09px;">4. Data Security </span>
<span class="t s0" style="left:110px;bottom:343px;letter-spacing:-0.1px;word-spacing:0.01px;">We take appropriate technical and organizational measures to protect your personal information </span>
<span class="t s0" style="left:110px;bottom:321px;letter-spacing:-0.09px;">from unauthorized access, disclosure, or misuse. </span>
<span class="t s0" style="left:110px;bottom:277px;letter-spacing:-0.09px;">5. Data Retention </span>
<span class="t s0" style="left:110px;bottom:254px;letter-spacing:-0.09px;word-spacing:0.01px;">We retain your email address only for as long as necessary to fulfill the purposes outlined in this </span>
<span class="t s0" style="left:110px;bottom:232px;letter-spacing:-0.12px;word-spacing:0.03px;">Privacy Policy or as required by law. </span>
<span class="t s0" style="left:110px;bottom:188px;letter-spacing:-0.23px;word-spacing:0.14px;">6. Your Rights </span>
<span class="t s0" style="left:110px;bottom:166px;letter-spacing:-0.18px;word-spacing:0.09px;">You have the right to: </span>
